Да, есть информация в контексте о карте "Карта возможностей". В разделе "Комиссии за обслуживание кредитной «Карта возможностей»" указано:

* "Обслуживание карты": {"Стоимость": "0 ₽", "Описание": "Независимо от суммы покупок"}

Это означает, что плата за обслуживание карты "Карта возможностей" равна 0 рублей.

По информации из контекста:

"Снятие наличных по QR-коду": {
  "Лимит в рамках пакета банковских услуг «Мультикарта»": {
    "Лимит": "60 000 ₽/день"
  },
  "Лимит в рамках пакета банковских услуг «Привилегия-Мультикарта»": {
    "Лимит": "200 000 ₽/день"
  },
  "Лимит в рамках пакета банковских услуг «Прайм+»": {
    "Лимит": "400 000 ₽/день"
  }
}

Лимит на снятие наличных через QR-код составляет:

* 60 000 ₽/день для пакета "Мультикарта"
* 200 000 ₽/день для пакета "Привилегия-Мультикарта"
* 400 000 ₽/день для пакета "Прайм+"

The daily limit for users of the "Multicard" package is 60,000 rubles.  


This information can be found in the "Снятие наличных по QR-коду" section:

